import React, { useState } from 'react';
import axios from 'axios';

function CreateFile() {
  const [fileData, setFileData] = useState({
    identification: '',
    name: '',
    lastName: '',
    description: '',
    
  });

  const handleCreate = () => {
    // Enviar una solicitud POST para crear un nuevo usuario en el servidor
    axios.post('http://localhost:3001/registerFile', fileData)
      .then((response) => {
        // Manejar la respuesta o redirigir a una página de éxito
        console.log('Expediente creado:', response.data);
        // Puedes redirigir a una página de éxito o a donde necesites
      })
      .catch((error) => {
        console.error(error);
      });
  };

  const handleInputChange = (e) => {
    const { identification, value } = e.target;
    setFileData({ ...fileData, [name]: value });
  };

  return (
    <div>
      <h1>Create File</h1>
      <form>
        <div>
          <label>Identification:</label>
          <input type="text" name="identification" value={setFileData.identification} onChange={handleInputChange} />
        </div>
        <div>
          <label>Name:</label>
          <input type="text" name="name" value={setFileData.name} onChange={handleInputChange} />
        </div>
        <div>
          <label>LastName:</label>
          <input type="text" name="lastName" value={setFileData.lastName} onChange={handleInputChange} />
        </div>
        <div>
          <label>Description:</label>
          <input type="text" name="description" value={setFileData.description} onChange={handleInputChange} />
        </div>
        
        <button onClick={handleCreate}>Create File</button>
      </form>
    </div>
  );
}

export default CreateFile;
